import ExpenseItem from "./ExpenseItem";
import "./Expenses.css";

function Expenses(props) {
    const title = props.title;
    const amount = props.amount;
    const date = props.date;

  return (
    <div className="Expenses">
      <ExpenseItem
        title={title}
        amount={amount}
        date={date}
      />
    </div>
  );
}

export default Expenses;
